                                <td>5 days</td>
                                <td className='warning'>Pending</td>

                            </tr>
                            <tr  className={cls === true ? 'decision clicked' : 'decision closed'}>
                                <td colSpan={2}>
                                    <button  className='approve' onClick={() => {setDecision('Approved'); setShowConfirmation(true);}}>Approve</button>
                                </td>
                                <td colSpan={3}>
                                    <button className='decline' onClick={() => {setDecision('Rejected'); setShowConfirmation(true);}}>Reject</button>
                                </td>
                                {showConfirmation && (
        <ConfirmationModal
          message="Are you sure you want to delete this item?"
          onConfirm={handleConfirm}
          onCancel={handleCancel}
        />
      )}
